style.css:
@-moz-document domain("roblox.com") {
/* Background */
body {
    background-color: #FFEBF0; /* Light pink background */
    font-family: 'Comic Sans MS', cursive, sans-serif; /* Kawaii font */
}

/* Navbar and Header */
.navbar, .header {
    background-color: #FFC1CC; /* Soft pink for navbar */
    border-bottom: 2px solid #FF69B4; /* Hot pink border */
}

/* Friend List */
.friend-list .friend-item .avatar {
    background-image: url('https://i.imgur.com/u5K5L3V.png') !important; /* Replace with a cute cat image URL */
    background-size: cover !important;
    border-radius: 50%;
    border: 2px solid #FF69B4; /* Hot pink border around cat image */
}

/* Buttons */
.button-primary {
    background-color: #FFB6C1; /* Light pink buttons */
    border: none;
    color: #ffffff;
}

.button-primary:hover {
    background-color: #FF69B4; /* Hot pink on hover */
}

/* Text Colors */
h1, h2, h3, h4, h5, h6, p, a {
    color: #FF1493; /* Deep pink text color */
}

/* Icons */
.icon {
    filter: hue-rotate(280deg); /* Adjust hue for a kawaii effect */
}

/* Avatar Editor Page Background */
body.avatar-editor-page {
    background-color: #FFEBF0 !important; /* Same light pink background for consistency */
}

/* Transparent overlay in Avatar Editor */
.avatar-editor-page .container-lg {
    background: transparent !important;
}
}
